interface SelectorItem {
    value: string
    label: string
}

function SingleSelector ({title, name, itemDatas}:{title: string, name: string, itemDatas: SelectorItem[]})  {




    const items = itemDatas.map((value) => {
        return (
            <FormControlLabel
                labelPlacement="end"
                value={value.value}
                style={{ height: 40 }}
                control={<Radio />}
                label={<div style={{ color: '#666', fontSize: 14 }}>{value.label}</div>} />
        )
    })
    return (
        <FormControl className={styles.formControl}>
            <div className={styles.actionTypeBox}>
                <RadioGroup row aria-label={name} name={name} defaultValue={"1"}>
                    <FormLabel component="legend" style={{ color: '#666', fontSize: 14, marginBottom: 0, marginRight: 20, borderBottom: "0", width: 'auto', height: '40px', lineHeight: '40px' }}>
                        {title}
                    </FormLabel>
                    {items}
                </RadioGroup>
            </div>
        </FormControl>
    )
}



